    [],nt"revision_timestamp": "2016-07-27T22:46:21.944915",nt"name": "horicon-national-wildlife-refuge-narrative-report-september-december-1959",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Horicon National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1959. The report begins by summarizing the weather, water, and habitat conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors and fish-
    is also covered. The Refuge development and maintenance section discusses physical
    development, plantings, collections and receipts, vegetation control, and wildfires.
    Resource management is outlined; topics include grazing, haying, and fur harvesting.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, and hunting. Items of interest, N-R forms, and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
